import React from "react";
import "../team/Team.css";
import teamBackground from "../images/teamBackground.png";
const Team = () => {
  return (
    <div className="teamMain">
      <div className="teamHeader">
        <h3>TEAM</h3>
      </div>
      <div className="row">
        <div className="col-3">Colm 1</div>
        <div className="col-3">Colm 2</div>
        <div className="col-3">Colm 3</div>
        <div className="col-3">Colm 4</div>
      </div>
      <div className="row">
        <div className="col-3">Colm 1</div>
        <div className="col-3">Colm 2</div>
        <div className="col-3">Colm 3</div>
        <div className="col-3">Colm 4</div>
      </div>
    </div>
  );
};

export default Team;
